        icon: 'dashboard',
    },
    {
        label: 'Login',
        type: 'label',
    },
    {
        name: 'Autenticação',
        icon: 'security',
        children: [
            {
                name: 'Login',
                iconText: 'SI',
                path: '/session/signin',
