            },
            {
                name: 'Esqueci minha senha',
                iconText: 'FP',
                path: '/session/forgot-password',
            },
            {
                name: 'Error',
                iconText: '404',
                path: '/session/404',
            },
        ],
    },

    {
        label: 'Páginas',
        type: 'label',
    },
    {
        name: 'Filtros',
        icon: 'format_list_bulleted',
        badge: { value: '10+', color: 'secondary' },
        children: [
            {
                name: 'Período',
                path: '/material/autocompletes',
